from typing import List

# 二分法找第二个数值
# O(nlogn) 
class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        N = len(numbers)
        
        for i in range(N): # O(n)
            diff = target - numbers[i]
            # print("i, numbers[i], diff = ", i, numbers[i],diff)
            low, high = i + 1, N - 1
            while low <= high: # O(logn)
                mid = (low + high) // 2
                if numbers[mid] == diff:
                    return [i+1, mid+1]
                elif numbers[mid] < diff:
                    low = mid + 1
                else:
                    high = mid - 1
        else:
            return [-1,-1]

# O(n)
    def twoSum_doublePointers(self, numbers: List[int], target: int) -> List[int]:
        N = len(numbers)
        left, right = 0, N-1

        while left < right:
            sumData = numbers[left] + numbers[right]
            if sumData > target:
                right -= 1
            elif sumData < target:
                left += 1
            else:
                return [left + 1, right + 1]
            
        return [-1, -1]
